'l10n/nls/template':{"liveFunction":{"summary":"여기에 이 함수에 대한 간단한 요약을 적어 주십시오.","description":"여기에 이 함수에 대한 자세한 설명을 적어 주십시오."},"liveClass":{"summary":"이 클래스에 대한 간단한 요약.","description":"이 클래스에 대한 자세한 설명.","propertySummary":"이 속성에 대한 간단한 요약","constructorSummary":"이 클래스의 객체를 생성하는 방법에 대한 설명.","methodSummary":"method1에 대한 자세한 설명."},"exampleContent":"%% 예제 제목\n% 예제의 개요\n\n%% 섹션 1 제목\n% 첫 번째 코드 블록에 대한 설명\na=1;\n\n%% 섹션 2 제목\n% 두 번째 코드 블록에 대한 설명\na=2;\n\n","functionContent":"function [outputArg1,outputArg2] = {fileName}(inputArg1,inputArg2)\n%{fileNameCaps} 이 함수의 요약 설명 위치\n%   자세한 설명 위치\noutputArg1 = inputArg1;\noutputArg2 = inputArg2;\nend","classContent":"classdef {fileName}\n   %{fileNameCaps} 이 클래스의 요약 설명 위치\n   %   자세한 설명 위치\n\n   properties\n        Property1\n    end\n\n   methods\n       function obj = {fileName}(inputArg1,inputArg2)\n       %{fileNameCaps} 이 클래스의 인스턴스 생성\n       %   자세한 설명 위치\n       obj.Property1 = inputArg1 + inputArg2;\n       end\n\n       function outputArg = method1(obj,inputArg)\n       %METHOD1 이 메서드의 요약 설명 위치\n       %   자세한 설명 위치\n       outputArg = obj.Property1 + inputArg;\n       end\n   end\nend","_localized":{}}
,
